import ExpenseItem from "./ExpenseItem";

function Expense(props) {
    const title = props.title;
    const amount = props.amount;
    const date = props.date;
    return (
        <ExpenseItem>
            {props.title}
            {props.amount}
            {props.date}
        </ExpenseItem>
        )
}
export default Expense;
